package com.example.fptacademysystem.dto;import java.io.Serializable;public class StaffAccountDTO implements Serializable {    private String staffid;    private String rollnum;    public StaffAccountDTO(){}    public String getStaffid() {        return staffid;    }    public void setStaffid(String staffid) {        this.staffid = staffid;    }    public String getRollnum() {        return rollnum;    }    public void setRollnum(String rollnum) {        this.rollnum = rollnum;    }}